var findTheDifference = function (s, t) {
  const sSortedStr = s.split('').sort().join('');
  const tSortedStr = t.split('').sort().join('');
  for (let i = 0; i < t.length; i++) {
    if (sSortedStr[i] !== tSortedStr[i]) return tSortedStr[i];
  }
};

console.log(findTheDifference(inp1, inp2));
